import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ItemList from './components/ItemList';
import StockEntryForm from './components/StockEntryForm';
import StockLedgerReport from './components/StockLedgerReport';

function App() {
  return (
    <Router>
      <div>
        <h1>Stock Management Dashboard</h1>
        <nav>
          <ul>
            <li><a href="/items">Items</a></li>
            <li><a href="/stock-entry">Stock Entry</a></li>
            <li><a href="/stock-ledger">Stock Ledger</a></li>
          </ul>
        </nav>

        <Routes>
          <Route path="/items" element={<ItemList />} />
          <Route path="/stock-entry" element={<StockEntryForm />} />
          <Route path="/stock-ledger" element={<StockLedgerReport />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
